import React from 'react'

const RegisterInfo = () => {
    const semester_id = 232;
    return (
        <div>
            <div className="title">
                <h1 className="item">Thống kê đăng kí theo môn học học kì {semester_id}</h1>
            </div>
        </div>
    )
}

export default RegisterInfo
